import ASIBSmall from './a-star-is-born/small.jpg';
import ASIBLarge from './a-star-is-born/large.jpg';
import BVSmall from './blue-valentine/small.jpg';
import BVLarge from './blue-valentine/large.jpg';
import LLLSmall from './la-la-land/small.jpg';
import LLLLarge from './la-la-land/large.jpg';
import TNSmall from './the-notebook/small.jpg';
import TNLarge from './the-notebook/large.jpg';
import TitaSmall from './titanic/small.jpg';
import TitaLarge from './titanic/large.jpg';

const romance = [
    { Title: 'A Star is Born', Small: ASIBSmall, Large: ASIBLarge },
    { Title: `Blue Valentine`, Small: BVSmall, Large: BVLarge },
    { Title: 'La La Land', Small: LLLSmall, Large: LLLLarge },
    { Title: 'The Notebook', Small: TNSmall, Large: TNLarge },
    { Title: 'Titanic', Small: TitaSmall, Large: TitaLarge },
]

export default romance;
